def convert_to_string(input_string):
    # 初始化空字符串
    result = ""
    # 按照括号拆分字符串
    parts = input_string.split(".ChR(")
    # 遍历拆分后的部分
    for part in parts:
        # 如果部分以数字开头（排除第一个部分）
        if part[0].isdigit():
            # 解析数字部分
            num_str = part.split(")")[0]
            # 将解析出的数字转换为整数
            num = int(num_str)
            # 将整数转换为对应的 ASCII 字符，并拼接到结果字符串中
            result += chr(num)
    return result

